  false,\n\t\"url\": null,\n\t\"notes\": \"The USGS Earth Resources Observation and
  Science (EROS) Center archive holds data collected by the Landsat suite of satellites.
  The Landsat Thematic Mapper (TM), a sensor carried on Landsats 4 and 5, acquired
  seven spectral bands of radiant energy from the earth's surface. The wavelength
  range for the TM sensor is from the visible through the mid-infrared and into the
  thermal-infrared portion of the electromagnetic spectrum. The scenes are approximately
  170 km by 185 km at a resolution of 30 meters for the six reflective bands and 120
  meters for the thermal band. Bands 1 through 5 and 7 are reflective wavelengths;
  band 6 is thermal data. The TM Film Only collection includes scenes that are no
  longer available on magnetic media and the only remaining source is on black-and-white
  film.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
